      "سياسة الخصوصية\n\nقامت شركة ISG ببناء تطبيق myfe كتطبيق تجاري. يتم توفير هذه الخدمة من قبل شركة ISG وتهدف للاستخدام كما هي.\n\nتُستخدم هذه الصفحة لإعلام مستخدمي التطبيق بسياساتنا من خلال جمع واستخدام والكشف عن المعلومات الشخصية إذا قرر أي شخص استخدام خدمتنا.\n\nإذا اخترت استخدام خدمتنا، فأنت توافق على جمع واستخدام المعلومات المتعلقة بهذه السياسة. يتم استخدام المعلومات الشخصية التي نجمعها لتوفير الخدمة وتحسينها. لن نستخدم أو نشارك معلوماتك مع أي شخص باستثناء ما هو موضح في سياسة الخصوصية هذه.\n\nجمع المعلومات واستخدامها:\nللحصول على تجربة أفضل أثناء استخدام خدمتنا، قد نطلب منك تزويدنا ببعض معلومات التعريف الشخصية، بما في ذلك على سبيل المثال لا الحصر جهات الاتصال الخاصة بك ورقم هاتفك وعنوان بريدك الإلكتروني وتاريخ ميلادك وموقعك. سيتم الاحتفاظ بالمعلومات التي نطلبها من قبلنا واستخدامها كما هو موضح في سياسة الخصوصية هذه.\n\nيستخدم التطبيق خدمات الجهات الخارجية التي قد تجمع المعلومات المستخدمة لتحديد هويتك.\n\nرابط إلى سياسة الخصوصية لموفري خدمات الجهات الخارجية التي يستخدمها التطبيق:\n- خدمات Google Play\n\nالبيانات المسجلة:\nنريد أن نعلمك أنه كلما استخدمت خدمتنا، في حالة حدوث خطأ في التطبيق، نقوم بجمع البيانات والمعلومات (من خلال منتجات الجهات الخارجية) على هاتفك تسمى البيانات المسجلة. قد تتضمن هذه البيانات معلومات مثل عنوان بروتوكول الإنترنت (IP) الخاص بجهازك واسم الجهاز وإصدار نظام التشغيل وتكوين التطبيق عند استخدام خدمتنا ووقت وتاريخ استخدامك للخدمة وإحصائيات أخرى.\n\nملفات تعريف الارتباط (Cookies):\nملفات تعريف الارتباط هي ملفات تحتوي على كمية صغيرة من البيانات تُستخدم عادةً كمعرّف فريد مجهول الهوية. يتم إرسال هذه إلى المستعرض الخاص بك من موقع الويب الذي تزوره ويتم تخزينها على الذاكرة الداخلية لجهازك.\n\nلا تستخدم هذه الخدمة ملفات تعريف الارتباط بشكل صريح. ومع ذلك، قد يستخدم التطبيق أكواد ومكتبات الجهات الخارجية التي تستخدم ملفات تعريف الارتباط لجمع المعلومات وتحسين خدماتها. لديك خيار قبول أو رفض ملفات تعريف الارتباط هذه ومعرفة متى يتم إرسال ملف تعريف الارتباط إلى جهازك. إذا اخترت رفض ملفات تعريف الارتباط الخاصة بنا، فقد لا تتمكن من استخدام بعض أجزاء هذه الخدمة.\n\nمقدمو الخدمة:\nيجوز لنا توظيف شركات وأفراد تابعين لجهات خارجية للأسباب التالية:\n- لتسهيل خدمتنا.\n- لتقديم الخدمة نيابة عنا.\n- لأداء الخدمات المتعلقة بالخدمة.\n- لمساعدتنا في تحليل كيفية استخدام خدمتنا.\n\nنود إبلاغ مستخدمي هذه الخدمة بأن هذه الأطراف الثالثة لها حق الوصول إلى معلوماتك الشخصية، والسبب هو أداء المهام المسندة إليهم نيابة عنا. ومع ذلك، فهي ملزمة بعدم الكشف عن المعلومات أو استخدامها لأي غرض آخر.\n\nالأمان:\nنحن نقدر ثقتك في تزويدنا بمعلوماتك الشخصية، وبالتالي نحن نسعى جاهدين لاستخدام وسائل مقبولة تجارياً لحمايتها. ومع ذلك، تذكر أنه لا توجد وسيلة للنقل عبر الإنترنت أو طريقة تخزين إلكترونية آمنة وموثوقة بنسبة 100٪، ولا يمكننا ضمان أمنها المطلق.\n\nروابط لمواقع أخرى:\nقد تحتوي هذه الخدمة على روابط لمواقع أخرى. إذا قمت بالضغط على رابط لجهة خارجية، فسيتم توجيهك إلى هذا الموقع. لاحظ أن هذه المواقع الخارجية لا تعمل من قبلنا. لذلك ننصحك بشدة بمراجعة سياسة الخصوصية الخاصة بهذه المواقع. ليس لدينا أي سيطرة ولا نتحمل أي مسؤولية عن المحتوى أو سياسات الخصوصية أو ممارسات أي مواقع أو خدمات تابعة لجهات خارجية.\n\nخصوصية الأطفال:\nلا تتعامل هذه الخدمات مع أي شخص يقل عمره عن 13 عامًا. نحن لا نجمع عن قصد معلومات التعريف الشخصية من الأطفال الذين تقل أعمارهم عن 13 عامًا. في حالة اكتشافنا أن طفلًا يقل عمره عن 13 عامًا قد زودنا بمعلومات شخصية، فإننا نحذفها على الفور من خدماتنا. إذا كنت أحد الوالدين أو الوصي وكنت على علم بأن طفلك قد زودنا بالمعلومات الشخصية، فيرجى الاتصال بنا حتى نتمكن من اتخاذ الإجراءات اللازمة.\n\nالتغييرات في سياسة الخصوصية:\nقد نقوم بتحديث سياسة الخصوصية الخاصة بنا من وقت لآخر. وبالتالي يُنصح بمراجعة هذه الصفحة بشكل دوري لأية تغييرات. سنعلمك بأي تغييرات من خلال نشر سياسة الخصوصية الجديدة على هذه الصفحة. هذه التغييرات فعالة فور نشرها على هذه الصفحة.",
